import React from "react";
import {

  Card,
  CardMedia,
  CardContent,
  Typography,
  CardActions,
  Button,
} from "@material-ui/core";
// import photoUrl from '../data/mems/dieta.jpg';

const Mem = (props) => {
  return (
    <div>
      <Card className="mem-card">
        <CardMedia
          style={{
            height: 0,
            paddingTop: "26.25%", // 16:9,
            marginTop: "30",
          }}
          image={props.mem.img}
          title={props.mem.ftitle}
          className = "mem-img"
        />
        {/* <img src="/data/mems/dieta.jpg"/> */}
        <CardContent>
          <Typography gutterBottom variant="headline" component="h2">
            {props.mem.title}
          </Typography>
        </CardContent>
        <CardActions>
          <Button size="small" color="primary">
            Upvote
          </Button>
          <p>{props.mem.upvotes}</p>
          <Button size="small" color="primary">
            Unvote
          </Button>
          <p>{props.mem.downvotes}</p>
        </CardActions>
      </Card>
    </div>
  );
};

export default Mem;
